  \"2016-07-27T22:45:33.542637\",\n\t\"name\": \"crescent-lake-national-wildlife-refuge-quarterly-narrative-report-august-september-octobe-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from August through October
  of 1941. The report begins by summarizing the weather conditions and food and cover
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, fish, reptiles, and disease- is also covered. The Refuge development
  and maintenance section discusses physical developments and wildfires. Resource
  management is outlined; topics include grazing and haying. The public relations
  section of the report describes Refuge visitors and violations. A short narrative
  on the North Platte Refuge is included. Photographs are attached.\",\n\t\"license_title\":
